import React, { useState } from 'react';
import { Button, TextField, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle } from '@material-ui/core';


export default function NutritionT() {
    
    function EnterNutrition() {
        const [open, setOpen] = useState(false);

        const handleOpen = () => {
            setOpen(true);
        }

        const handleClose = () => {
            setOpen(false);
        }

        return (
            <div>
                <Button color="primary" onclick={handleOpen}>
                    Enter Details
                </Button>
                <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                    <DialogTitle id="form-dialog-title">Enter your food and its calories</DialogTitle>
                    <DialogContent>
                        <DialogContentText>
                            Enter the food name
                        </DialogContentText>
                        <TextField
                            autoFocus
                            margin="dense"
                            id="foodName"
                            label="Name"
                            type="text"
                            fullWidth
                            />
                            <DialogContentText>
                            Enter the total number of calories it contained
                        </DialogContentText>
                        <TextField
                            autoFocus
                            margin="dense"
                            id="foodCal"
                            label="Calories"
                            type="text"
                            fullWidth
                            />
                    </DialogContent>
                    <DialogActions>
                        <Button color="primary" onClick={handleClose}>
                        Close 
                        </Button>
                    </DialogActions>
                </Dialog>
            </div>
        );
    }

    return (
        <div>
            <div>
                <h2>Nutrition Tracker</h2>
            </div>
            <div>
                <EnterNutrition />
            </div>
        </div>
    );
    }
